import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import AuthUser from './AuthUser';

export default function Dashboard() {
  const { wpisy, fetchPosts } = AuthUser();

  useEffect(() => {
    fetchPosts();
  }, []);

  return (
    <div>
      <h1>Dashboard</h1>
      <Link to="/addwpis"><button className="btn btn-success">
        Dodaj
      </button></Link>
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>User</th>
            <th>Tresc</th>
          </tr>
        </thead>
        <tbody>
          {wpisy.map((wpisy) => (
            <tr key={wpisy.id}>
              <td>{wpisy.id}</td>
              <td>{wpisy.user_id}</td>
              <td>{wpisy.tresc}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
